import React from "react";

export default function WhoAre() {
  return (
    <div className="whoAreBox">
      <p className="hoverText">
        Advanced digital services and time-saving solutions that allow
        organizations to adapt to new markets, maximising efficiency and
        effectiveness through seamless, scalable and secure digital
        environments. We integrate vision, creativity and technology in a single
        team, stablishing a hyper-collaborative agile approach that simplifies
        processes and optimise efforts. Our team becomes an extension of your
        team, sharing ideas, challenges, goals and expertise to build
        first-class digital infrastructures and results-oriented products.
      </p>
    </div>
  );
}
